import {useEffect} from "react"
import "./progress"
function ProgressBar() {
    useEffect(()=>{
        resize()
    },[])

  const resize = ()=> {
    var bar = document.getElementByClassName("progress")
    bar.style.width = `${50}%`
   
  }
  return (
    <div id="barcontainer">
      <div className="bar">
        <div className="progress"></div>
      </div>
      <button>Click me!</button>
    </div>
  );
}

export default ProgressBar;
